import React, { Component } from "react";

export class NewsItem extends Component {
  render(props) {
    let { title, description } = this.props;
    return (
      <div>
        <div className="card bg-success " style={{ width: "18rem" }}>
          <img
            className="card-img-top"
            src="https://cdn.vox-cdn.com/thumbor/OUXCHj2CEPIyC7jH6k-9nEKbzl0=/0x135:2606x1499/fit-in/1200x630/cdn.vox-cdn.com/uploads/chorus_asset/file/23647633/Screen_Shot_2022_06_23_at_3.31.15_PM.png" alt="imagehhg"
          />
          <div className="card-body">
            <h5 className="card-title">{title}</h5>
            <p className="card-text">{description}</p>
            <a href="/" className="btn btn-primary">
              Go somewhere
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default NewsItem;
